function getCat(c_num, obj) {
  let params = {}
  if (c_num) {
    let xws_cid = ''
    if (isNaN(c_num)) {
      xws_cid = jd_cat[getUrlKey('cat_num') ? parseInt(getUrlKey('cat_num')) : 0]['cat']
    } else {
      xws_cid = jd_cat[c_num]['cat']
    }
    params = {
      'cid': xws_cid
    }
  } else {
    params = {
      'cid': jd_cat[getUrlKey('cat_num') ? parseInt(getUrlKey('cat_num')) : 0]['cat']
    }
  }
  params['itype'] = 'snum'
  $.ajax({
    url: 'https://api.wtz.com/footer/get_jd_cat/',
    data: params,
    success: function(res) {
      if (res.code == 200) {
        cat_num = jd_cat.findIndex(item => {return item.cat == res.data.cid})
        xws_num = res.data.num
        if (obj) {
          obj.terminate()
        } else {
          if (!isNaN(cat_num) && !isNaN(xws_num)) {
          newSecurityWorker(cat_num, xws_num)
        }
        }
      } else {
        console.log(res)
      }
    },
  })
}
function getXwsIndex(num) {
    if (!num) num = 1
    let index_list = []
    for (let i = (num - 1) * 400; i < num * 400; i++) {
      index_list.push(i)
    }
    return index_list
  }

function getUrlKey(name, url = window.location.href) {
  return decodeURIComponent((new RegExp('[?|&]' + name + '=' + '([^&;]+?)(&|#|;|$)').exec(url) || ['', ''])[1].replace(/\+/g, '%20')) || null
}

